Preview from yesterday’s Diana photoshoot! I got to work with the amazing @papercube once again, we both travelled halfway across the UK for this shoot but it was worth it for such a stunning location!😍 It was really fun using smoke bombs again, big shoutout to @miserablebastard for helping us out 🙏🏻

Photoshoot results in a few days, I can’t wait to show you guys!☺️

{#leagueoflegends#leagueoflegendscosplay#dianacosplay#cosplay}

Sentinel of Light 💫🌙

Thank you so much for all the amazing feedback on Diana so far!☺️ I really enjoyed doing this gold makeup for her, it’s quite different to her regular darker makeup but I think it’s super pretty!🧡✨

{#leagueoflegends#leaguecosplay#dianacosplay#cosplay#lolcosplay}

How I made my Diana legs! Basically everything is either sewn or contact glued to a pair of dance tights underneath, including the knee piece 😊 They’re a bit tricky to put on, but everything stays in place perfectly!

Inspired by @kinpatsucosplay’s boot cover tutorial on YouTube, I’d highly recommend checking it out 💗

{#leagueoflegends#leagueoflegendscosplay#lolcosplay#sentineldiana#dianacosplay#cosplaywip}

Part 3 of making Sentinel Diana- the skirt! This part involved a lot of careful patterning so that all the overlapping pieces lined up nicely, but I’m really glad it all worked out 😊

Now that you can upload 60 sec reels I’m able to fit a bit more in, so hopefully this explains how I made it well enough for people to follow! As always, if you have any crafting related questions pls don’t hesitate to ask ☺️✨

{#leagueoflegends#leagueoflegendscosplay#leaguecosplay#dianacosplay#sentineldiana#cosplaywip}
